import React from 'react'
import { Button } from 'reactstrap'

const WeatherForm = ({ setCity, addCity, targetCity }) => {
  console.log('CITY', targetCity)
  return (
    <div>
      <input
        type="text"
        placeholder="Název města"
        className="m-3"
        onChange={setCity}
      />
      {console.log(targetCity)}
      <Button onClick={targetCity => addCity(targetCity)}>Přidat město</Button>
    </div>
  )
}

export default WeatherForm
